'''
Given a string s, find the length of the longest substring without repeating characters.



Example 1:

Input: s = "abcabcbb"
Output: 3
Explanation: The answer is "abc", with the length of 3.
Example 2:

Input: s = "bbbbb"
Output: 1
Explanation: The answer is "b", with the length of 1.
Example 3:

Input: s = "pwwkew"
Output: 3
Explanation: The answer is "wke", with the length of 3.
Notice that the answer must be a substring, "pwke" is a subsequence and not a substring.
'''

def lengthOfLongestSubstring_naive(s: str) -> int:
    chars = list(s)
    len_chars = len(chars)
    res = {} # [i, j, length] 
    for i in range(len_chars):
        for j in range(i+1, len_chars+1):
            target_list = chars[i:j]
            target_set = set(target_list)
            if len(target_list) == len(target_set):
                res[(i, j)] = len(target_list)
    # print(res)
    # print(res.values())   
    if len(res) == 0:
        val = 0
    else:
        val = max(list(res.values()))

    return val

def lengthOfLongestSubstring(s: str) -> int:
    chars = list(s)
    len_chars = len(chars)
    res = {} # [i, j, length]
    pointer = 0
    for i in range(len_chars):
        for j in range(i+1, len_chars+1):
            target_list = chars[i:j]
            target_set = set(target_list)
            if len(target_list) == len(target_set):
                res[(i, j)] = len(target_list)
    # print(res)
    # print(res.values())   
    if len(res) == 0 and s=="":
        val = 0
    elif len(res) == 0 and s!="":
        val = 1
    else:
        val = max(list(res.values()))

    return val

